import React from 'react';
import Navbar from './components/Navbar/Navbar';
import Footer from './components/Footer/Footer';
import  Hero from './pages/';  

const App = () => {
  const styles = {
    main: {
      textAlign: 'center',
      padding: '20px',
    },
  };

  return (
    <div>
      <Navbar />

      {/* Main Landing Page Content */}
      <main style={styles.main}>
        <h1>Welcome to HealthScreen</h1>
        <p>Prevention is the smarter way to stay healthy and happy.</p>
        {/* Replace with <LandingPage /> once it's built */}
      </main>

      <Footer />
    </div>
  );
};

export default App;
